; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51); color: rgb(51, 51, 51);\\\">يهدف هذا المشروع إلى دعم صمود الشعب الفلسطيني من خلال نشر ثقافة خاصة بالأبنية الخضراء خاصة الممارسات الموفرة للطاقة والمياه والموارد الطبيعية، والتي تؤدي لخفض فاتورة الكهرباء التي يدفعها الشعب الفلسطيني للاحتلال، توفير مصادر الماء ومعالجتها وإعادة استخدامها، رفع قدرات الشباب الفلسطيني، بالإضافة لخلق فرص عمل لهذا النوع من القدرات والمهارات بين الشباب الفلسطيني في قطاع الهندسة والبناء وتجارة المواد والأدوات التابعة للأبنية الخضراء وتخفيف الضغط على المصادر والثروات الطبيعية في ظل النمو السكاني، بدون التأثير على احتياجات المواطنين الأساسية.</span></p>\"}',NULL,'activity',NULL,1,NULL,'publish',NULL,'2022-01-14 21:16:09','2024-05-15 18:28:45','2024-05-17 09:11:01',NULL,0,NULL,0,NULL),(60,1,'{\"ar\":\"يوم ساعة الارض\"}','yom-saaa-alard-event','{\"ar\":\"يهدف هذا المشروع إلى دعم صمود الشعب الفلسطيني من خلال نشر ثقافة خاصة بالأبنية الخضراء خاصة الممارسات الموفرة للطاقة والمياه والموارد الطبيعية،\"}','{\"ar\":\"<p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51); color: rgb(51, 51, 51); color: rgb(51, 51, 51); color: rgb(51, 51, 51);\\\">يهدف هذا المشروع إلى دعم صمود الشعب الفلسطيني من خلال نشر ثقافة خاصة بالأبنية الخضراء خاصة الممارسات الموفرة للطاقة والمياه والموارد الطبيعية، والتي تؤدي لخفض فاتورة الكهرباء التي يدفعها الشعب الفلسطيني للاحتلال، توفير مصادر الماء ومعالجتها وإعادة استخدامها، رفع قدرات الشباب الفلسطيني، بالإضافة لخلق فرص عمل لهذا النوع من القدرات والمهارات بين الشباب الفلسطيني في قطاع الهندسة والبناء وتجارة المواد والأدوات التابعة للأبنية الخضراء وتخفيف الضغط على المصادر والثروات الطبيعية في ظل النمو السكاني، بدون التأثير على احتياجات المواطنين الأساسية.</span></p>\"}',NULL,'event',NULL,1,NULL,'publish',NULL,'2022-05-11 21:28:58','2024-05-15 18:30:58','2024-05-15 19:15:14',NULL,0,NULL,0,NULL),(61,1,'{\"ar\":\"خليل خصيب\",\"en\":\" Khalil \"}','khalil','{\"ar\":\"يهدف التدريب إلى استعراض المتطلبات الفنية للنسخة الرابعة من نظام تقييم الأبنية الخضراء \\\"الريادة في تصميمات الطاقة والبيئة للمباني قيد الإنشاء\\\". بالإضافة إلى التعرف إلى النقاط الإجبارية والاختيارية لكل واحدة من فئات الشهادة، وكيفية ملائمتها حسب نوع المشروع\",\"en\":\"\"}','{\"ar\":\"<p>يهدف التدريب إلى استعراض المتطلبات الفنية للنسخة الرابعة من نظام تقييم الأبنية الخضراء &quot;الريادة في تصميمات الطاقة والبيئة للمباني قيد الإنشاء&quot;. بالإضافة إلى التعرف إلى النقاط الإجبارية والاختيارية لكل واحدة من فئات الشهادة، وكيفية ملائمتها حسب نوع المشروع. يقدم التدريب المعرفة اللازمة للتطبيق العملي الناجح للنظام من خلال التعرف إلى هدف كل واحدة من نقاط النظام ومتطلباتها ومعاييرها وتكاملها مع النقاط والفئات الأخرى. سيتم أيضاً التطرق إلى التكاملية والفروقات بين نظام الإنشاء ونظام التصميم الداخلي.</p>\",\"en\":\"<p>sddsdsdsdsdsdssdds</p>\"}',NULL,'administration',NULL,1,NULL,'publish',NULL,'2024-05-16 02:33:12','2024-05-15 23:34:05','2024-05-17 08:31:44',NULL,0,NULL,0,NULL),(62,1,'{\"ar\":\"عربي\"}','ثثصق','{\"ar\":null}','{\"ar\":\"<p>شصيشصيشصيشصيشصيشصيشصي</p>\"}',NULL,'partner',NULL,1,NULL,'publish',NULL,'2024-05-17 15:19:23','2024-05-17 12:19:37','2024-05-17 12:19:37',NULL,0,NULL,0,NULL),(63,1,'{\"ar\":\"الرؤية و الرسالة والهدف الرئيسي\"}','alroy-o-alrsal-oalhdf-alryysy','{\"ar\":null}','{\"ar\":\"<h1><strong>الرؤية</strong></h1><p>قيادة قطاع البناء لتطوير وتطبيق مشاريع البناء الخضراء في فلسطين.</p><h1><strong>الرسالة</strong></h1><p>بناء القدرات لدعم التصميم والإنشاء وتشغيل الأبنية المستدامة في فلسطين.</p><h1><strong>الهدف الرئيسي</strong></h1><p>تطوير الثقافة والوعي البيئية في الصناعة الإنشائية في فلسطين ومواكبة الجهود العالمية في بناء مستقبل أخضر.</p><p style=\\\"text-align: end; text-align: end; ;\\\"></p><div class=\\\"filament-tiptap-grid-builder\\\" data-type=\\\"responsive\\\" data-cols=\\\"2\\\" style=\\\"grid-template-columns: repeat(2, 1fr);\\\" data-stack-at=\\\"md\\\"><div class=\\\"filament-tiptap-grid-builder__column\\\" data-col-span=\\\"1\\\" style=\\\"grid-column: span 1;\\\"><p><img src=\\\"/storage/images/073afaf9-3b6a-4a4a-9296-27f7b23e05a1.png\\\" width=\\\"200\\\" height=\\\"119\\\"></p></div><div class=\\\"filament-tiptap-grid-builder__column\\\" data-col-span=\\\"1\\\" style=\\\"grid-column: span 1;\\\"><p>asasasasasas</p></div></div><p></p>\"}',NULL,'page',NULL,1,NULL,'publish',NULL,'2024-05-17 15:28:05','2024-05-17 12:32:36','2024-05-17 15:48:44',NULL,0,NULL,0,NULL),(64,1,'{\"ar\":\"حزمة العضوية\"}','hzm-alaadoy','{\"ar\":null}','{\"ar\":\"<h2>حزمة العضوية</h2><p>فيما يلي نظام العضوية الخاصة بالمجلس الفلسطيني للأبنية الخضراء، يشمل فئات العضوية ومزايا العضوية وتفاصيل أخرى.</p><p><br>الأساسيات<br><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">المجلس الفلسطيني للأبنية الخضراء هو منظمة أهلية تهدف إلى:</span><br><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">إيجاد وتطبيق مبادئ البناء الأخضر في جميع مراحل العمليات البنائية بهدف إنشاء مباني خضراء في فلسطين.</span></p><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">تبعاً لنظام المجلس العالمي للأبنية الخضراء، هناك عدة تصنيفات للعضوية في المجلس الفلسطيني للأبنية الخضراء موضحة فيما يلي:</span></p><ul><li><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">العضوية الكاملة: يمكن للأعضاء الاستفادة من جميع مزايا وخدمات المجلس. بحيث يكون عملهم متعلق مباشرة ببيئة البناء الأخضر</span></p></li><li><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">.عضوية الانتساب: يمكن للأعضاء الاستفادة من بعض مزايا المجلس بدون مقابل مادي. وليس لهم الحق بالتصويت في انتخابات مجلس الإدارة. تشمل الأعضاء الداعمين دون أن يكون عملهم يتعلق مباشرة بالبناء الأخضر. و تشمل الطلاب والداعمين المهتمين بفكرة الأبنية الخضراء</span></p></li><li><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">العضوية الفخرية: تشمل الأعضاء الداعمين لمجلس الأبنية الخضراء وبيئة الأبنية الخضراء في فلسطين. لا يوجد رسوم عضوية للعضوية الفخرية ولا يمكنهم الاستفادة من مزايا وخدمات المجلس. لا يوجد للأعضاء الفخريين حقوق تصويت</span></p></li></ul><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">باب العضوية متاح للأفراد والمؤسسات.</span></p><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">*العضوية الكاملة متاحة للأفراد والمؤسسات</span></p><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">*عضوية الانتساب والعضوية الفخرية متاحة فقط للأفراد</span></p><p></p><p><span style=\\\"color: rgb(51, 51, 51); font-family: Cairo; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none; color: rgb(51, 51, 51);\\\">الجدول التالي يوضح تصنيفات العضوية المعتمدة لدى المجلس الفلسطيني تماشياً مع نظام العضوية في المجلس العالمي للأبنية الخضراء.</span></p><table><tbody><tr><th rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">التصنيف</p></th><th rowspan=\\\"1\\\" colspan=\\\"1\\\"><p style=\\\"text-align: center; ;\\\">الوصف</p></th></tr><tr><td rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">1</p></td><td rowspan=\\\"1\\\" colspan=\\\"1\\\"><p>الأفراد</p></td></tr><tr><td rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">2</p></td><td rowspan=\\\"1\\\" colspan=\\\"1\\\"><p>مصنعي وموزعي مواد البناء</p></td></tr><tr><td rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">3</p></td><td rowspan=\\\"1\\\" colspan=\\\"1\\\"><p>مزودي خدمات المرافق الكهربائية مزودي الخدمات وخدمات الطاقة، وخدمات المياه والصرف الصحي</p></td></tr><tr><td rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">4</p></td><td rowspan=\\\"1\\\" colspan=\\\"1\\\"><p>المستثمرين؛ مالكين ومدراء المباني، تشمل المباني التجارية والسكنية والتعليمية والحكومية وغيرها</p></td></tr><tr><td rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">5</p></td><td rowspan=\\\"1\\\" colspan=\\\"1\\\"><p>مزودي الخدمات الاستشارية، تشمل المعماريين والمهندسين والمصممين والمخططين والمحاميين ومدراء المشاريع والمدراء الماليين والمساحين ومصممي الديكور والمصممين العمليات الصناعية والاستشاريين البيئيين وأعمال تحليل وتمثيل الطاقة (النمذجة).</p></td></tr><tr><td rowspan=\\\"1\\\" colspan=\\\"1\\\" data-colwidth=\\\"82\\\"><p style=\\\"text-align: center; ;\\\">6</p></td><td rowspan=\\\"1\\\" colspan=\\\"1\\\"><p>شركات ووسطاء العقارات</p></td></tr><tr><td rows